import React from 'react';
import { Link } from 'react-router-dom';
import './styles/header.css';  

const Header = () => {
  return (
    <header>
      <h1>My Shop</h1>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/cart">Cart</Link>
        <Link to="/profile">Profile</Link>
      </nav>
    </header>
  );
};

export default Header;
